import './App.css';
import {useState, useEffect} from 'react';


function App() {

  const [order, setOrders] = useState([]);

  useEffect(() => {

      fetch('http://localhost:5000/rapi/v1/orders', {
        'methods' : 'GET',
        headers: {
          'Content-Type':'application/json'
        }
      })
      .then(resp => resp.json())
      .then(resp => setOrders(resp))
      .catch(error => console.log(error))

  }, [])

  return (
    <div className="App">

      <h1> Flask & React</h1>
            <p>{order[1].notes}</p>
            <p>{order[1].quantity}</p>
    </div>
  );
}

export default App;
